import '../styles/card.sass'
import React from 'react'

function Card(props) {

	const data = props.data
	return (
		<div className='dataCard'>
			{data.map((data) =>

				<li className='CardLi' key={data.id}>
					<img className='imgCard' src={data.cover} alt={data.title} />
					<h3>{data.title}</h3>					
				</li>
			)}

		</div>
	)
}
export default Card;
